import React from 'react'
import './Popup.css'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faArrowRight } from '@fortawesome/free-solid-svg-icons'

function Popup(props) {

    const handleSubmit = () => {
        
    }

    return (props.trigger) ? (
        <div className="popup">
            <div className="popup-inner">
                <button className="close-btn" onClick={() => props.setTrigger(false)}><FontAwesomeIcon icon={ faArrowRight} /></button>
                <form autoComplete="off" noValidate onSubmit={handleSubmit}>
                    <input placeholder="room name" className="room-name" /><br></br>
                    <input type="radio" className="pick-room-type" id="private" name="check" value="private"/>
                    <label for="private">private</label><br></br>
                    <input type="radio" className="pick-room-type" id="public" name="check" value="public"/>
                    <label for="public">public</label><br></br>
                </form>
            </div>
        </div>
    ) : "";
}

export default Popup
